import TuitList from '../tuit-list/tuit-list-item';
import React from "react";

const HomeScreen = () => {
    return(
        <div>
            <div>
                <h2>Home</h2>
            </div>
            <div className="col-2 col-md-2 col-lg-1 col-xl-2">
                <TuitList/>
            </div>
        </div>
    );
};
export default HomeScreen;
